import React, {useState} from 'react';

export default function Currency() {
  const [Weight, setWeight] = useState(0);
  const [litres, setLitres] = useState(0);
  const [gramz, setGramsleft] = useState(0);
  const [Bottles, setBottles] = useState(0);
  const [Time, setTime] = useState(0);
  const [Burning, setBurning] = useState(0);

  function handleSubmit(e) {
    e.preventDefault();
    const litres = Bottles * 0.33;
    setLitres(litres);
  }

  function grams(e) {
    e.preventDefault();
    const gramz = litres * 8 * 4.5;
    setGrams(gramz);
  }

  function burning(e) {
    e.preventDefault();
    const Burning = Weight / 10;
    setBurning(Burning);
  }

  function gramsleft(e) {
    e.preventDefault();
    const gramsleft = gramz - (Burning * Time);
    setGramsleft(gramz);
  }

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <h3>Calculating alcohol blood level</h3>
        <label>Weight</label>
        <input type="number" value={Weight} onChange={e => setWeight(e.target.value)} />
        <br />
        <label>Bottles</label>
        <input type="number" value={Bottles} onChange={e => setBottles(e.target.value)} />
        <br />
        <label>Time</label>
        <input type="number" value={Time} onChange={e => setTime(e.target.value)} />
        <br />
        <label>Gender</label>        
        <input type="radio" value="FEMALE" /> Female       
        <input type="radio" value="MALE" /> Male
      </div>
      <div>
        <output>{litres}</output>
        <output>{Burning}</output>

      </div>
      <button>Calculate</button>
    </form>
  )
}
